import React, {useEffect, useState} from 'react';
import './App.css';

function App() {
  const [question, setQuestion, questioner, setQuestioner] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        setQuestioner(data[0]);
        setQuestion(data[1]);
      })
    );
  }, [])

  return <div className="App"/>;
}

export default App;
